// frontend/src/App.js — temporary debug App
import React from "react";

export default function App(){
  return (
    <div style={{ padding: 40, fontFamily: "Arial, sans-serif", color: "#0b1220" }}>
      <h1 style={{ marginBottom: 10 }}>Debug: React rendering OK</h1>
      <p>If you see this, the React bundle loaded and React is rendering.</p>
      <p><strong>Port:</strong> {window.location.port || "unknown"}</p>
      <p>Open DevTools Console and paste any errors here if you still see a blank page.</p>
    </div>
  );
}
